export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},X6PzAKRZev:{data:{id:2445,attributes:{imdbId:"tt1714208",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMmM3ZmFmNDctMDEwZS00ODhlLWE0OWQtZTljMGNiZjg2ZTFiXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.0\u002F10"},{Source:"Rotten Tomatoes",Value:"73%"},{Source:"Metacritic",Value:"58\u002F100"}],item_lang:{data:{id:3108,attributes:{title:g,plot:"Raised by wolves, the vulnerable last survivor of a cannibalistic tribe bathes wounded in a river somewhere in the lush woods of Northeast Coast, where she used to roam free. In the eyes of misogynistic lawyer Chris, the naked beast-like savage seems to be the perfect trophy for his home; however, is there a place for a feral, flesh-eating primitive among civilized people? In the following days, bent on domesticating the untamed female by breaking her will, the sadistic man will make the woman his project, as Chris' dysfunctional family struggles to keep the proud predator in captivity. But very soon, no restraints, no training--and, certainly, no male supremacy--will be able to match the raging woman's raw, merciless retaliation. Can they escape from the monster's fury?",slug:"the-woman"}}},books:{data:[{id:11818,attributes:{title:g,description:"The Woman is the last of her kind, the lone survivor of a tribe of feral cannibals who have terrorized the Maine coast for years. She is wounded and weak, but she's found refuge in a cave overlooking the sea. Christopher Cleek is an amoral—and unstable—lawyer who sees her bathing in a stream one day while he's out hunting. Cleek has dark, cruel secrets and he will now add one more. He will capture the Woman, lock her in his cellar, and attempt to tame her, with the help of his wife and children. But very soon the question will become: Who is more savage, the hunter or the prey?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=1hU3EAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b,"Lucky McKee"],firstBook:true,published:"2021-07-06",publisher:h,subtitle:a}},{id:11819,attributes:{title:"The Girl Next Door",description:"Special Leisure movie tie-in edition. A teenage girl is held captive and brutally tortured by neighborhood children. Based on a true story, this shocking novel reveals the depravity of which we are all capable.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Go8aAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2008-01-01",publisher:a,subtitle:a}},{id:11820,attributes:{title:"A Little Emerald Book of Ephemera",description:"The fifth in Little Book Series II is Jack Ketchum's A Little Emerald Book of Ephemera, a delightful collection of essays, opinions, reflections, and even a few poems. Included in this collection: \"A Week in the Work-Life of a Nonessential Author\" \"Barflies\" \"Remembering Charlie\" \"Afterword to Tales from a Darker State\" \"On Writing The Girl Next Door\" \"Afterword to the Movie Tie-In Edition of The Girl Next Door\" \"Introduction to the Filmscript of The Girl Next Door\" \"On The Lost\" \"Foreword to Cover\" \"Afterword to Hide and Seek\" \"Afterword to Old Flames\" \"On Writing Joyride\" \"Afterword to Only Child aka Strangehold\" \"Afterword to the Unexpurgated Off Season\" \"On Writing Offspring\" \"Talked to God\" \"Introduction to The Crossings\" \"Afterword to Sleep Disorder\" \"Elvis Ku\" \"The I'm Not Sam Blogs\" \"On John Carpenter's The Thing\"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DDHvDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2020-07-03",publisher:h,subtitle:a}},{id:11821,attributes:{title:"Fear the Fever",description:"Featuring contributions by Jack Ketchum, Edward Lee, and Graham Masterton, this latest installment in the Hot Blood series centers around ordinary people who have been possessed by a sensual sickness for which there is no cure. Original.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hhYOo1_4W70C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"Graham Masterton","Edward Lee"],firstBook:d,published:"2005-08-30",publisher:"Pinnacle Books",subtitle:a}},{id:11822,attributes:{title:"Red",description:"The old man hears them before he sees them, the three boys coming over the hill, disturbing the peace by the river where he's fishing. He smells gun oil too, too much oil on a brand-new shotgun. These aren't hunters, they're rich kids who don't care about the river and the fish and the old man. Or his dog. Red is the name of the old man's dog, his best friend in the world. And when the boys shoot the dog--for nothing, for simple spite--he sees red, like a mist before his eyes. And before the whole thing is done there'll be more red. Red for blood.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tX2uoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2014-03-25",publisher:"47North",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309593377}}("","Jack Ketchum","movie",null,"series",1,"The Woman","Crossroad Press"))